%[text] # Git in MATLAB
%[text:tableOfContents]{"heading":"**Table of Contents**"}
%[text] ## Setting up a project
%[text] ### From scratch
%[text] ### Cloning an existing one
%[text] Via command line:
%[text] ```matlabCodeExample
%[text] !git clone https://github.com/ebenetce/DynareModelParallel.git
%[text] ```
%[text] Via the MATLAB function
%[text] ```matlabCodeExample
%[text] repo = gitclone("https://github.com/ebenetce/DynareModelParallel.git");
%[text] ```
%[text] ## Open the project
openProject('DynareModelParallel\')
%[text] ## Add a Model
%[text] Let's download a famous model
websave('Smets_Wouters_2007_45.mod', ...
    "https://raw.githubusercontent.com/JohannesPfeifer/DSGE_mod/refs/heads/master/Smets_Wouters_2007/Smets_Wouters_2007_45.mod")
%[text] And add it to your project. This will sync our Git repo automatically:
%[text] ![](text:image:4324)
%[text] Let's check the models runs:


